function [ys_, params, info] = steadystate(ys_, exo_, params)
% Steady state generated by Dynare preprocessor
    info = 0;
    phi_ss=(1+params(11))*params(10)/(1+params(11)*params(10));
    ys_(7)=params(19);
    ys_(1)=1.0;
    ys_(22)=1.0;
    ys_(3)=params(6);
    ys_(2)=1-params(6);
    ys_(18)=phi_ss^(params(11)/(1+params(11)));
    ys_(19)=(1-params(6))*ys_(18);
    ys_(20)=params(6)*ys_(18);
    ys_(4)=params(7)*exp(params(4));
    ys_(6)=params(6)*ys_(4);
    ys_(5)=(1-params(6))*ys_(4);
    ys_(9)=ys_(7)*params(6);
    ys_(8)=ys_(7)*(1-params(6));
    ys_(10)=0;
    ys_(12)=0;
    ys_(11)=0;
    ys_(13)=0;
    ys_(14)=0;
    alpha_N_ss=(1-phi_ss)*params(8)/(1+params(9));
    ys_(17)=ys_(1)*params(8)/ys_(7);
    ys_(21)=ys_(2)-ys_(18)^(1+1/params(11))/(1+1/params(11));
    theta_N_s=(1-phi_ss)*ys_(17)*ys_(21)^(-params(1))/ys_(7)^(1/params(5));
    r_ss=(1+params(3))^0.25-1.0;
    beta_ss=1/(1+r_ss)*exp(params(4))^params(1);
    delta_ss=1+params(6)/params(7)-exp(params(4));
    alpha_K_ss=params(7)*(r_ss+delta_ss)/(1+params(9));
    ys_(23)=params(4);
    ys_(15)=ys_(9)*ys_(17)*exp(ys_(23))*alpha_K_ss/alpha_N_ss/ys_(6);
    ys_(16)=ys_(15);
    ys_(24)=0;
    ys_(25)=0;
    ys_(26)=0;
    ys_(27)=0;
    ys_(28)=0;
    ys_(29)=0;
    ys_(30)=0;
    ys_(31)=0;
    ys_(32)=0;
    ys_(33)=0;
    lab_prod_obs=0;
    ys_(36)=0;
    ys_(35)=0;
    % Auxiliary equations
end
